gn that you use in composing a written document. The words you are reading in this article are set in a particular font style used extensively by Monster.ca.<br></p><p>Fonts come in distinct families. They differ in terms of their look and other qualities, such as size, weight and spacing.<br></p><p><strong>Font Readability</strong></p><p></p><p><a href=\\\"https://www.monster.ca/career-advice/article/how-to-send-your-resume-via-email\\\" target=\\\"\\\">When you submit your resume in response to a job posting</a>, your document will either be read directly by people, or will get scanned first into an electronic applicant tracking system. In either case its vital that the fonts you use make your words easy to interpret.</p><p></p><p>Simple, clean fonts like Arial orVerdanaguarantee the readability of your text. More ornate fonts, such as those named Informal, Roman, or Chiller, may give your document more personality. They will certainly stand out from ordinary typefaces. However they may also make the reader strain their eyes, or the letters may not be correctly interpreted by scanners. This can drop your resume to the bottom of the pile.</p><p></p><p><strong>Clean And Sleek Versus Fancy And Memorable</strong></p><p><strong></strong></p><p>There are two main categories of typefaces. One is called Serif, the other is Sans Serif.</p><p>Serif fonts tend to be more stylized. They all have little markings, curves or hooks as part of their design. Here are some examples of Serif font families:<br></p><ul><li>Times New Roman</li><li>Bookman Old Style</li><li>Century</li></ul>', '0', '1', '0', '0', '97', '0')||INSERT INTO teeme_leaf VALUES ('98', '0', '1', '1', '0', '1', '2017-10-04 11:18:16', '2017-10-04 11:18:15', '<p>        </p><p>     </p><p><strong>By Mark Swartz<br>Monster Senior Contributing Writer</strong></p><p></p><p><br>The content of your resumeall those carefully chosen <a href=\\\"https://www.monster.ca/career-advice/article/ten-resume-mistakes-canada\\\" ta